let playlists = [
  {
    id: "5",
    playlist: [
      "Reload",
      "Blended Together",
      "The First Show",
      "Ticket",
      "The Wave",
    ],
  },
  {
    id: "4",
    playlist: ["Sure", "Four Turtles", "Duke's Revenge", "Ticket", "Reload"],
  },
  {
    id: "3",
    playlist: [
      "The Wave",
      "The First Show",
      "Ticket",
      "Reload",
      "Blended Together",
    ],
  },
  {
    id: "2",
    playlist: ["The First Show", "Blended Together", "The Wave", "Ticket"],
  },
  { id: "1", playlist: ["Blended Together", "The Wave", "Ticket"] },
];

export function getPlaylists() {
  return playlists;
}

export function getPlaylist(id) {
  return playlists.find((playlist) => playlist.id === id).playlist;
}
